import React, { Component } from 'react';
import './Hello.css';

class Hello extends Component {

   render(){
      return(
      <div className='h1 tc'>
      <h1> hello google I am coming </h1>
      <p> {this.props.greeting} </p>
      </div>
      );
   }

}

export default Hello;
